import React from "react";
import ReactDOM from 'react-dom';
import { Grid, GridColumn as Column } from '@progress/kendo-react-grid';

import "../user-management/user-management.css";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css"
import "../../styles/ledgers/ledgers.css";
import '../../../node_modules/@progress/kendo-theme-bootstrap/dist/all.css';

class UserManagement extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {

    function UserManagementGrid(props) {
        return (
            <Grid
                style={{ height: '400px' }}
                data={[]}
            >
                <Column field="" title="Last Name" width="250px" />
                <Column field="" title="First Name" width="250px" />
                <Column field="" title="User Name" />
                <Column field="" title="User Type" />
                <Column field="" title="Status" />
            </Grid>
        )
    }

    return (
        <div className="content">
        <div id="chemicalAreaLedgerHeader" className="ledgerTitle">User Management</div>
        <br/>
        <div>
          <UserManagementGrid />
        </div>  
        </div>
    )
  }
} 

export default UserManagement;
